import logo from './assets/postImage.png';
import './App.css';
function App() {

  let data = require('./post.json');
  let postTitle = data.postTitle;
  let postContent =data.postContent;

  return (
    <div className="App">
        <div>
            <img src={logo} alt="logo" />
        </div>

      <div>
        {postTitle}
      </div>

      <div>
        {postContent}
      </div>
    </div>
  );
}

export default App;
